import React, { useState } from "react";

function LoginPage() {
  const [cnt,setCnt]=useState(0);
  const Welcome= React.createElement(
    "button",
    {
      className:"btn",
      onClick:()=>setCnt(cnt+1),
    },
    "Clcik Me"
  );

  return (
    <div>
      <p>Count : {cnt} </p>

    </div>
  );
}

export default LoginPage;
